import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
function Navigation(){
    return(
        <Router>
<div className="flex flex-row items-center gap-1 shadow-sm w-full min-h-10 h-12">

        <p className="pl-4 text-green-500 font-semibold text-3xl">
        MOKI
        </p>
    <div>
    <Link to="/">
        <p className="pl-10 hover:text-black text-gray-600 cursor-pointer ">
        Home
        </p>
    </Link>
    </div>
    <div>
    <Link to="/schedule">
    <p className="hover:text-black text-gray-600 cursor-pointer ">
        Schedule
    </p>
    </Link>
    </div>

</div>
<Switch>
          <Route path="/schedule">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
</Router>
    )
}

function Home() {
    return <h2>Home</h2>;
  }

  function About() {
    return <h2>About</h2>;
  }

  function Users() {
    return <h2>Users</h2>;
  }

export default Navigation;
